import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route } from 'react-router-dom';

const App = ()=>{
    return(
        <BrowserRouter>
            <Route path="/"></Route>
            <Route path="/about" component=""></Route>


        </BrowserRouter>
    )
}



ReactDOM.render(<App />, document.getElementById('root'));
